- input: "TEXT\x1CC00277541\x1C.TEXT\x1C\x1CF3XA\x1CThis amendment is needed to realign
    starting balances with the previous FEC report and to correct typographical errors
    in data entry. Procedures have been reviewed and adjusted to avoid these types
    of errors being encountered in preparing future reports of the Committee. The
    Fairfax County Democratic Committee is an all volunteer organization. We have
    no paid staff, and no other organization pays any staff who devote any portion
    of their time to the Committee's political activities. As such, activities in
    support of candidates are largely volunteer exempt activities. Furthermore, in
    the 2007 year of a two year election cycle, the Committee supports only candidates
    for non federal, or state and local political offices. Fund raising is strictly
    for benefit of the Committee and not for any named candidate. None of the expenditures
    or receipts resulting from party fund raising are attributable to any federal
    candidate. The Committee has opted not to allocate its administrative expenses
    pursuant to regulation. Instead, all administrative expenses of the Committee
    are paid from the Committee's Federal Account, including expenses which might
    otherwise  be allocated to the Committee's Non-Federal Account.\n"
